INSERT INTO `aboutus` (`id`, `topic`, `image`, `description`, `status`) VALUES
(8, 'MEET THE BUSINESS OWNER', 'uploads/aboutus/md.jpg', '<span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\">Praful Srivastava is the Business Owner of SCORERS, Bangalore. After completing his graduation in Engineering,&nbsp;</span><span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\">Srivastava&nbsp;</span><span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\">was not looking out for a career in the software industry, rather he always wanted to be his own boss, and not work under someone. An opportunity with a marketing company gave him a chance to explore his entrepreneurial skills and run a business of his own. And that is how&nbsp;</span><span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\">&nbsp;SCORERS</span><span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\">&nbsp;came into existence. His current expansion plan includes expanding the business in major cities of South India and across India as well as exploring newer business partners and products to promote.</span>', 1),
(9, 'Who We Are', 'uploads/aboutus/C8.jpg', '<span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\">SCORERS is one of India\'s fastest growing unconventional, dynamic and young-spirited marketing & Advertising companies. We thrive to deliver excellence in service to both our clients and customers and today we are one of the fastest growing Marketing Organization. </span><br style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\">SCORERS</span><span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\"> WAS STARTED ON SEPT 2015 IN BANGALORE. <br></span><br style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\">Through the combination of total commitment to our people, clients, customers and a high standard of work ethics we are confident we will meet all of our expectations and exceed them in the future.</span>', 1),
(10, 'Our Service', 'uploads/aboutus/C71.jpg', '<span style=\"color: rgb(34, 34, 34); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\">For our clients, we provide a simple and effective marketing strategy</span><ul class=\"default-list\" style=\"margin: 15px 0px; padding: 0px; list-style-type: none; position: relative; color: rgb(34, 34, 34); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\"><li style=\"color: rgb(132, 132, 132); line-height: 30px;\"><span class=\"fa fa-check-square-o\" style=\"font-size: 14px; color: rgb(244, 125, 39); margin-right: 12px;\"></span>We provide a professional, dedicated sales and marketing team for their campaigns</li><li style=\"color: rgb(132, 132, 132); line-height: 30px;\"><span class=\"fa fa-check-square-o\" style=\"font-size: 14px; color: rgb(244, 125, 39); margin-right: 12px;\"></span>We create exposure of their product or service whilst maximizing the impact with a cost effective method</li></ul><br style=\"color: rgb(34, 34, 34); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(34, 34, 34); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\">For the consumer, we provide quality and convenience</span><ul class=\"default-list\" style=\"margin: 15px 0px; padding: 0px; list-style-type: none; position: relative; color: rgb(34, 34, 34); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\"><li style=\"color: rgb(132, 132, 132); line-height: 30px;\"><span class=\"fa fa-check-square-o\" style=\"font-size: 14px; color: rgb(244, 125, 39); margin-right: 12px;\"></span>Quality products and services conveniently accessed and tailored to their individual needs and wants</li><li style=\"color: rgb(132, 132, 132); line-height: 30px;\"><span class=\"fa fa-check-square-o\" style=\"font-size: 14px; color: rgb(244, 125, 39); margin-right: 12px;\"></span>Unrivalled levels of customer service, providing customer satisfaction</li></ul><br style=\"color: rgb(34, 34, 34); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(34, 34, 34); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\">For our people, we provide unlimited career opportunities</span><ul class=\"default-list\" style=\"margin: 15px 0px; padding: 0px; list-style-type: none; position: relative; color: rgb(34, 34, 34); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\"><li style=\"color: rgb(132, 132, 132); line-height: 30px;\"><span class=\"fa fa-check-square-o\" style=\"font-size: 14px; color: rgb(244, 125, 39); margin-right: 12px;\"></span>Structured ongoing training and continual support through a network currently spanning over 21 countries</li><li style=\"color: rgb(132, 132, 132); line-height: 30px;\"><span class=\"fa fa-check-square-o\" style=\"font-size: 14px; color: rgb(244, 125, 39); margin-right: 12px;\"></span>Promotions determined by measured achievements</li></ul>', 1);

