(1, 'Career', '<span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\">The career opportunities available to grow are tremendous with a massive brand exposure. In retrospect to the ever-progressing demands and the spending power of the consumer, there is always a huge demand for better professionals to create brand exposure in a target specific market. In a unique business like ours one truly gets exposed to the potential of being successful. With guaranteed promotion based on performance and achievement, we help you to achieve your targets with efficient training programs from time to time. We invest in our people to maximize their potential to develop their attitude, energy and ability. The ultimate opportunity extends to all involved to eventually grow into the ability of running their own individual companies. If you are looking for a challenge and a real business opportunity, you’ve come to the right place. We are an ambitious and successful growing team which is constantly looking for new people to work with us.</span>', 1),
(2, '', '<p><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp Image 2019-08-18 at 3.37.20 AM.jpeg\" style=\"width: 420px;\">                            </p>', 1);

