INSERT INTO `services` (`id`, `cat_id`, `description`, `status`) VALUES
(2, 4, '<p><img src=\"data:image/jpeg;base64,\" data-filename=\"ContinuousLearning.jpeg\" style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px; width: 336px; height: 262.5px; float: none;\"><span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px;\"><br></span></p><p><span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px;\"><br></span></p><p style=\"text-align: justify; \">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px;\">We have a systematic development among all levels of employee’s skills and attitude which contributes their welfare, which subsequently reflects in the company’s growth and development.</span><br></p><p xss=\"removed\" style=\"text-align: justify; line-height: 26px; padding: 0px; font-family: Hind, sans-serif; font-size: 16px; color: rgb(132, 132, 132);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span xss=\"removed\">We build the learner’s ability and mould the knowledge, skills, behavior, attitude and aptitude towards the requirement of the job and the organization.</span></p>', 1);
INSERT INTO `services` (`id`, `cat_id`, `description`, `status`) VALUES
(4, 5, '<p><img src=\"data:image/png;base64,\" data-filename=\"CUSTOMER AQUISTION.png\" style=\"width: 878px;\"><span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px;\"><br></span></p><p style=\"text-align: justify; \">&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(132, 132, 132); font-family: Hind, sans-serif; font-size: 16px;\">Acquisition programs then include establishing a relationship with prospects to identify their needs and determine how the products offered relate to those needs. Salespeople also attempt to identify unstated needs; these are based on data provided by ongoing conversations and interactions with the prospects. Salespeople also can identify additional needs of prospects and offer additional products so the prospects see a greater value from purchasing the products they already are considering.</span>                            </p>', 1);

