INSERT INTO `service_page_content` (`id`, `topic`, `description`, `status`) VALUES
(1, 'Our Service To The Clients', '<p style=\"padding: 0px; font-family: Hind, sans-serif; font-size: 16px; color: rgb(132, 132, 132); line-height: 26px; text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;At SCORERS we provide our clients from the service industry, an opportunity to have a face-to-face presentation of their offered services by a trained professional to the prospective customer through human touch with a strong advertising message. This combines the information of an advertisement with the reassurance of word of mouth recommendations and customer service that we feel is second to none.</p><br style=\"color: rgb(34, 34, 34); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\"><p style=\"padding: 0px; font-family: Hind, sans-serif; font-size: 16px; color: rgb(132, 132, 132); line-height: 26px; text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;Direct Marketing is widely acknowledged as the most effective method of acquiring new customers and increasing brand awareness. It has forced many large companies to re-evaluate their traditional marketing strategies and outsource their direct marketing requirements to us.</p><br style=\"color: rgb(34, 34, 34); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\"><p style=\"padding: 0px; font-family: Hind, sans-serif; font-size: 16px; color: rgb(132, 132, 132); line-height: 26px; text-align: justify;\">Our key objective is to deliver a high standard customer service till the end consumer as well as an excellent yet cost effective marketing campaign for our clients. Our comprehensive sales coaching and business development program ensures that clients are represented to the highest standard and the Field Representatives we contract are the best possible brand ambassadors.</p>', 1),
(2, 'What we do for our people?', '<p style=\"padding: 0px; font-family: Hind, sans-serif; font-size: 16px; color: rgb(132, 132, 132); line-height: 26px; text-align: justify;\">In today\'s marketing world, a lot of routes to the market have been tried and tested. Among these, traditional advertising – TV, radio and print – is quite expensive and calculating the ROI can be very difficult over a long period of time. It\'s also difficult to cut through the entire marketing buzz\' that is created. Consumers are exposed to over 10,000 messages every day!</p><p style=\"padding: 0px; font-family: Hind, sans-serif; font-size: 16px; color: rgb(132, 132, 132); line-height: 26px; text-align: justify;\"><br style=\"color: rgb(34, 34, 34);\"></p><p style=\"padding: 0px; font-family: Hind, sans-serif; font-size: 16px; color: rgb(132, 132, 132); line-height: 26px; text-align: justify;\">A more direct, face–to–face approach is required. That\'s why Stars management exists. Our approach is to homes, businesses, shopping arenas and events; through which we facilitate real people engaging directly with consumers – face to face. We call it \'The Human Commercial\'</p>', 1),
(3, 'We provide our business partners with:', '<ol style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; list-style-type: none; color: rgb(34, 34, 34); font-family: Hind, sans-serif; font-size: 16px; text-align: justify;\"><ol><li><span class=\"fa fa-check-square-o\"></span>Full marketing accountability</li><li><span class=\"fa fa-check-square-o\"></span>Trained and experienced sales marketers</li><li><span class=\"fa fa-check-square-o\"></span>A tailored approach</li><li><span class=\"fa fa-check-square-o\"></span>Economies of scale from our unparalleled size</li><li><span class=\"fa fa-check-square-o\"></span>The ability to scale up and down as required</li><li><span class=\"fa fa-check-square-o\"></span>A campaign support team looking out for our partner\'s best interests</li></ol><li>&nbsp; &nbsp; &nbsp;7. Access to the resources they need to flourish</li></ol>', 1),
(4, 'Expansion Plan', '<p style=\"padding: 0px; font-family: Hind, sans-serif; font-size: 16px; color: rgb(132, 132, 132); line-height: 26px; text-align: justify;\">In the coming months, we plan to open more group companies in various potential cities of SOUTH INDIA including COCHIN, COIMBATORE, MANGALORE &amp; MYSORE also in the pipeline across India.</p><p style=\"padding: 0px; font-family: Hind, sans-serif; font-size: 16px; color: rgb(132, 132, 132); line-height: 26px; text-align: justify;\">Our expansion plans work hand-in-hand with our aim to provide access to the world-class products &amp; services to a large base of customers &amp; also to bring employment opportunities to the masses.</p>', 1);

